import React from "react";
import EffButton from "./EffButton";

const EffList = () => {
  return (
    <div>
      <EffButton eff="0" />
      <EffButton eff="0.5" />
      <EffButton eff="1" />
      <EffButton eff="2" />
    </div>
  );
};

export default EffList;
